import { BrowserRouter as Router, Routes, Route, Link, Navigate } from 'react-router-dom';
import Header from '../components/common/header';
import secretsmanagement from '../components/common/secretsmanagement';


function HomePage() {
  return (
    <div className="min-h-screen flex flex-col bg-black">
      <Header /> {/* Header and navigation links updated to use <Link> */}

      <div className="flex-grow container mx-auto flex flex-col justify-center items-center p-4">
        <h1 className="md:max-w-3xl text-4xl md:text-6xl lg:text-7xl text-white font-extrabold md:leading-tighter lg:leading-tighter tracking-tight mt-3">womp womp</h1>
        {/* "Get Started" button linking to the Signup Page */}

        <secretsmanagement />
      </div>

      {/* Grid for searching job keyword and location */}
      <div className="grid grid-cols-2 gap-4 p-4">
        {/* Search job keyword */}
        <div className="max-w-md mx-auto">
          <input type="text" className="w-full p-2 border border-gray-300 rounded mb-4" placeholder="Search jobs..." />
          <button className="w-full bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
            Search
          </button>
        </div>
        {/* Search job location (Assuming this is the intent) */}
        <div className="max-w-md mx-auto">
          <input type="text" className="w-full p-2 border border-gray-300 rounded mb-4" placeholder="Location..." />
          <button className="w-full bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
            Search
          </button>
        </div>
      </div>

      {/* Job Listings */}
      <div className="container mx-auto p-4">
        {/* Content remains the same */}

      </div>

      <div className="mt-6 mx-auto max-w-md m-12">
        <Link to="/signup" className="inline-block bg-blue-500 hover:bg-blue-700 text-white font-bold py-3 px-6 rounded-lg text-lg">Get Started</Link>
      </div>

      {/* Footer */}
      <footer className="bg-gray-200 text-center p-4">
        Â© 2024 Technology Talent Holdings (TTH), inc.
      </footer>
    </div>
  );
}

export default HomePage;
